module.exports = {
  root: true,
  parser: '@typescript-eslint/parser',
  plugins: ['@typescript-eslint'],
  extends: ['@react-native-community'],
  rules: {
    'react-native/no-inline-styles': 0,
    semi: [1, 'never'],
    '@typescript-eslint/no-unused-vars': [1, { args: 'none' }],
  },
  env: {
    browser: true,
    node: true,
  },
}

const libDir = process.env.LIB_DIR;
const { defaults: tsjPreset } = require('ts-jest/presets');

const transformPackages = [
  '@react-native',
  'react-native',
  'react-native-modal-popover',
  'react-native-collapsible',
  '@bang88/react-native-ultimate-listview',
  '@react-native-community',
  'react-native-gesture-handler',
  'react-native-reanimated'
];

module.exports = {
  "preset": "react-native",
  "setupFilesAfterEnv": ["@testing-library/jest-native/extend-expect"],
  "setupFiles": ["./jestSetup.js"],
  moduleFileExtensions: ['ts', 'tsx', 'js', 'jsx', 'json'],
  testPathIgnorePatterns: ['/node_modules/', '_site', 'site'],
  transform: {
    ...tsjPreset.transform,
    '^.+\\.js$': '<rootDir>/node_modules/react-native/jest/preprocessor.js',
    '\\.png': '<rootDir>/tests/imageStub.js',
  },
  testRegex: libDir === 'dist' ? 'demo\\.test\\.js$' : '.*\\.test\\.js$',
  collectCoverageFrom: [
    'components/**/*.{ts,tsx}',
    '!components/*/style/*.{ts,tsx}',
  ],
  transformIgnorePatterns: [
    `node_modules/(?!(${transformPackages.join('|')})/)`,
  ],

  globals: {
    'ts-jest': {
      babelConfig: true,
      tsConfig: 'tsconfig.test.json',
    },
  },
};

const path = require('path')
module.exports = {
  presets: ['module:metro-react-native-babel-preset'],
  plugins: [
    [
      'import',
      {
        libraryName: '@ant-design/react-native',
        customName: (name) => {
          return path.resolve(__dirname, `./components/${name}`)
        },
      },
    ],
  ],
}

import 'react-native-gesture-handler/jestSetup'

jest.mock('react-native/Libraries/Animated/NativeAnimatedHelper')

jest.mock('react-native', () => {
  const RN = jest.requireActual('react-native')
  RN.NativeModules.RNCCameraRollPermissionModule = {}
  return RN
})

/**
 * Metro configuration for React Native
 * https://github.com/facebook/react-native
 *
 * @format
 */

module.exports = {
  transformer: {
    getTransformOptions: async () => ({
      transform: {
        experimentalImportSupport: false,
        inlineRequires: true,
      },
    }),
  },
};

module.exports = {
  dependency: {
    assets: ['../icons-react-native/fonts'],
  },
  project: {
    android: {
      sourceDir: './rn-kitchen-sink/android',
    },
  },
};

{
  "extends": "./tsconfig.json",
  "compilerOptions": {
    "jsx": "react",
    "target": "es5",
    "esModuleInterop": true
  }
}

const getWebpackConfig = require('@ant-design/tools/lib/getWebpackConfig.js')
const webpackConfig = getWebpackConfig(false)

module.exports = webpackConfig
